import { BsSearch,BsPerson,BsCart} from 'react-icons/bs';
import { AiOutlineHeart } from 'react-icons/ai';

import "../App.css"

const Icons = () => {
  return (
    <div className="icons">

    <div className="searchBar">


    <BsSearch/>
    </div>
    <AiOutlineHeart/>
    <BsPerson/>
    <BsCart/>

    </div>
  )
}

export default Icons
